import { makeStyles } from "@material-ui/core";

export default makeStyles((theme) => ({
    search: {
        display: 'flex',
        justifyContent: 'center',
        
    },
    searchInput: {
        display: 'flex',
    },
    input: {
        border: '3px solid #252C6F',
        borderRadius: '4px 0px 0px 4px',
        padding: '2px',
        background: '#D4EBEE',
        focus: 'none',
        width: '300px',
        display: 'flex',
        justifyContent: 'center',

    },
    results: {
        marginTop: '5px',
        width: '300px',
        height: '200px',
        backgroundColor: 'white',
        boxShadow: 'rgba(0, 0, 0, 0.35) 0px 5px 15px',
        overflow: 'hidden',
        overflowY: 'auto',
        scrollbarDisplay: 'none',
        
    },

    icon: {
        height: ' 40px',
        width: '35px',
        background: ' white',
        display: 'grid',
        placeItems: 'center',
        backgroundColor: '#53a9bc',
        borderRadius: '0px 4px 4px 0px',
        border: '3px solid #252C6F',
        
    },
    
    iconSvg: {
        fontSize: '35px',
    },
    item: {

    }
})) ;
